import { margin } from "@mui/system";
import React from "react";
import './App.css';
import { LastSeq } from "./LastSeq";
import NewSelect from './NewSelect';
import Typography from '@mui/material/Typography';
import GruppenSelect from "./GruppenSelect";

function App() {
    document.title = "Greensoftweb"

    return (
        <div>
            <header className={'App-header fst-italic fs-1 fw-bold bg-white'}>
                Greensoft
            </header>
            <div>
            <Typography sx={{ mt: 3,  ml:5, paddingTop:2, mb:0, fontStyle: 'italic' }} variant="h5" component="h4">
        Lastsequenz auswählen und speichern
          </Typography>
            <LastSeq />
            </div>

            <div id="newSelectContainer">
            <Typography sx={{ mt: 5,  ml:5,fontStyle: 'italic' }} variant="h5" component="h4">
        Vergleich und Analyse durchführen
          </Typography>
          <NewSelect /> 
            </div>

           {/* <div>
            <GruppenSelect />
            </div> */}
        </div>
    );
}

export default App;
